import React from 'react'

 export default class Update_data extends React.Component{
    constructor() {
        super();
        this.state = {
            uname: 'Chandra',
            address: 'Hathras',
            phone: 12345
        }
    }

    change_data = () =>{
        this.setState({
            uname: 'Mohan', 
            address: 'Agra',
            phone: 987654
        });
    }

    render() {
        return (
            <div>

                <p>Name: {this.state.uname}</p>
                <p>Address: {this.state.address}</p>
                <p>Phone: {this.state.phone}</p>
                <button type="button" onClick={this.change_data}>Update Data</button>
            </div>
        );
    } 

   }
